import React, { useState, useEffect } from "react";

const Register = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-6">
          <h3>REGISTER AS CANDIDATE</h3>
        </div>
        <div className="col-lg-6">
          <h2>Your Details</h2>
        </div>
      </div>
    </div>
  );
};
export default Register;
